import axios from 'axios';

// URL backend Python FastAPI Anda
const PYTHON_API_BASE_URL = 'http://127.0.0.1:8000/api/v1'; 

export const generateNextQuestion = async (userId, role, level) => {
    // Instalasi axios diperlukan: npm install axios
    
    // Ini adalah kode asli yang sudah kita rancang
    const response = await axios.post(`${PYTHON_API_BASE_URL}/generate-question`, {
        user_id: userId,
        role: role,
        level: level,
    });
    return response.data; 
};
